CREATE TRIGGER `t_invoice_detail_add` AFTER INSERT ON `invoice_details` FOR EACH ROW BEGIN
UPDATE tasks SET remain_ratio = IFNULL(remain_ratio,100) - IFNULL(new.yield_ratio,0) WHERE id =  new.task_id;
UPDATE tasks SET remain_ratio = 100 WHERE id = new.task_id AND remain_ratio>100;
UPDATE tasks SET remain_ratio = 0 WHERE id = new.task_id AND remain_ratio<0;
END
$$
