UPDATE tasks SET remain_ratio = 100 WHERE id = old.task_id AND remain_ratio>100;
UPDATE tasks SET remain_ratio = 0 WHERE id = old.task_id AND remain_ratio<0;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `t_invoice_detail_upd` AFTER UPDATE ON `invoice_details` FOR EACH ROW BEGIN
UPDATE tasks SET remain_ratio = IFNULL(remain_ratio,100) + IFNULL(old.yield_ratio,0) WHERE id = old.task_id;
UPDATE tasks SET remain_ratio = IFNULL(remain_ratio,100) - IFNULL(new.yield_ratio,0) WHERE id = new.task_id;
UPDATE tasks SET remain_ratio = 100 WHERE id = new.task_id AND remain_ratio>100;
UPDATE tasks SET remain_ratio = 0 WHERE id = new.task_id AND remain_ratio<0;
