DELIMITER $$
CREATE TRIGGER `t_invoice_masters_del` BEFORE DELETE ON `invoice_masters` FOR EACH ROW BEGIN
  DELETE FROM invoice_details WHERE invoice_master_id = old.id;
  IF (SELECT COUNT(*) FROM schedules WHERE pay_ratio=0)=0 THEN
    UPDATE schedules SET status=1 WHERE id=old.schedule_id; 
  ELSE
    UPDATE schedules SET status=1 WHERE subject_id=old.subject_id; 
  END IF;
  IF (SELECT COUNT(*) FROM invoice_masters WHERE invoice_id = old.invoice_id)=0 THEN 
    DELETE FROM invoices WHERE id=old.invoice_id;
  END IF;
  
  IF (SELECT COUNT(*) FROM invoice_masters WHERE subject_id=old.subject_id AND invoice_id != old.invoice_id)=0 THEN
      UPDATE subjects SET process=20 WHERE id=old.subject_id;
  END IF;


END
$$
