DELIMITER $$
CREATE TRIGGER `t_subjects_add` AFTER INSERT ON `subjects` FOR EACH ROW BEGIN

  #　案件の状態が「受注」「進行中」の場合は以下の処理を行う
#  IF new.process>=10 && new.process<30 && old.process<10 THEN

    #　対象案件に紐づくスケジュールの内、区分＝「着工」のレコード数をカウントし、変数「@count1」にセットする
    SET @count1 = (SELECT COUNT(*) FROM schedules WHERE class=10 AND subject_id = new.id);

    #　対象案件に紐づくスケジュールの内、区分＝「完了」のレコード数をカウントし、変数「@count2」にセットする
    SET @count2 = (SELECT COUNT(*) FROM schedules WHERE class=20 AND subject_id = new.id);

    #　対象案件に紐づく顧客の「締切日」を元に、今月を基準とした締切日を求め、変数「@closing_date」にセットする
    SET @closing_date = (SELECT CONCAT(DATE_FORMAT(now(), '%Y-%m-'),bill_closing) FROM clients WHERE id = new.client_id);

    #　変数「@count1」が「０」か否かを判定
    #　  「@count1 = 0」の場合、変数「@start_date」に案件の「着工日」をセットする
    #　   「@count1 <> 0」の場合、変数「@start_date」にスケジュールの「着工日」をセットする
    IF @count1=0 THEN
      SET @start_date = new.start_date;
    ELSE
      SET @start_date = (SELECT start_date FROM schedules WHERE class=10 AND subject_id=new.id);
    END IF;

    #　変数「@start_date」と「@closing_date」を判定
    #　  「@start_date > @closing_date」の場合、変数「@closing_start」に変数「@closing_date」の翌月をセットする
    #　  「@start_date <= @closing_date」の場合、変数「@closing_start」に変数「@closing_date」をセットする
    IF @start_date>@closing_date THEN
      SET @closing_YM1=date_format(DATE_ADD(@closing_date, INTERVAL 1 MONTH),'%Y-%m'); 
    ELSE
      SET @closing_YM1=date_format(@closing_date,'%Y-%m');   
    END IF;

    #　変数「@count2」が「０」か否かを判定
    #　  「@count2 = 0」の場合、変数「@end_date」に案件の「完了日」をセットする
    #　  「@count2 <> 0」の場合、変数「@end_date」にスケジュールの「完了日」をセットする
    IF @count2=0 THEN
      SET @end_date = new.end_date;
    ELSE
      SET @end_date = (SELECT end_date FROM schedules WHERE class=20 AND subject_id=new.id);
    END IF;

    #　変数「@end_date」と「@closing_date」を判定
    #　  「@end_date > @closing_date」の場合、変数「@closing_start」に変数「@closing_date」の翌月をセットする
    #　  「@end_date <= @closing_date」の場合、変数「@closing_start」に変数「@closing_date」をセットする
    IF @end_date>@closing_date THEN
      SET @closing_YM2 = date_format(DATE_ADD(@closing_date, INTERVAL 1 MONTH),'%Y-%m'); 
    ELSE
      SET @closing_YM2=date_format(@closing_date,'%Y-%m');    
    END IF;


    #　案件の分類を判定
    IF new.class = 1 THEN
      #「足場」の場合は以下の処理を行う
      #  「架け」のスケジュールが存在しない場合はレコードを追加し、存在する場合は更新する
#      IF @count1=0 THEN
#      ELSE
#        UPDATE schedules SET pay_ratio=(new.pay_ratio * percentage)/100 WHERE subject_id=new.id AND class = 10;
#      END IF;
      #  「払い」のスケジュールが存在しない場合はレコードを追加し、存在する場合は更新する
#      IF @count2=0 THEN
#        INSERT INTO schedules (class,subject_id,start_date,end_date,closing) SELECT 20 ,new.id,new.end_date,new.end_date,@closing_YM2;
#      ELSE
#        UPDATE schedules SET pay_ratio=((100-new.pay_ratio) * percentage)/100 WHERE subject_id=new.id AND class = 20;
#      END IF;
    ELSE
      #　「一般」の場合は以下の処理を行う
      IF new.pay_status=10 THEN
        SET @closing_YM=@closing_YM1; 
      ELSE
        SET @closing_YM=@closing_YM2; 
      END IF;
#      IF @count1=0 THEN
#      ELSE
#        UPDATE schedules SET pay_ratio=(new.pay_ratio * percentage)/100 WHERE subject_id=new.id AND class = 10;
#      END IF;
    END IF;

#  END IF;

END
$$
DELIMITER ;
