DELIMITER $$
CREATE TRIGGER `t_tasks_upd` AFTER UPDATE ON `tasks` FOR EACH ROW BEGIN

  IF NEW.amount <> OLD.amount THEN
    SET @tax_state = (SELECT tax_state FROM subjects WHERE id = NEW.subject_id);
    SET @expenses = (SELECT SUM(amount) FROM tasks WHERE subject_id = NEW.subject_id);
    SET @bill_amount = (SELECT @expenses - discount FROM subjects WHERE id = NEW.subject_id);
    IF @tax_state = 1 THEN
      SET @tax = ROUND((@bill_amount * 10) / 110);
    ELSEIF @tax_state = 2 THEN
      SET @tax = ROUND(@bill_amount / 10);
      SET @bill_amount = @bill_amount + @tax;
    ELSE
      SET @tax = 0;     
    END IF;
    UPDATE subjects SET expenses=@expenses,tax=@tax,bill_amount=@bill_amount WHERE id = NEW.subject_id;
  END IF;

  IF NEW.class <> OLD.class THEN
    SET @count = (SELECT COUNT(*) FROM tasks WHERE subject_id = OLD.subject_id AND class = OLD.class);
    IF @count = 0 THEN
      UPDATE subjects SET status=CONCAT(LEFT(status, OLD.class-1),'0',RIGHT(status, 255-OLD.class)) WHERE id = NEW.subject_id;
    END IF;
    UPDATE subjects SET status=CONCAT(LEFT(status, NEW.class-1),'1',RIGHT(status, 255-NEW.class)) WHERE id = NEW.subject_id;
  END IF;

END
$$
DELIMITER ;

